import uuid

class Submission:
    def __init__(self, data):
        self.submission_id = str(uuid.uuid4())
        self.data = data
        self.status = 'pending'
        self.errors = []

    def validate(self):
        self.errors.clear()
        if not self.data.get('title'):
            self.errors.append("Title is required.")
        if not self.data.get('content'):
            self.errors.append("Content is required.")
        # Add more validations as needed
        return len(self.errors) == 0

    def publish(self):
        if self.validate():
            self.status = 'published'
            return True
        else:
            return False

    def get_status(self):
        return self.status

    def get_errors(self):
        return self.errors

class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def create_submission(self, data):
        submission = Submission(data)
        self.submissions[submission.submission_id] = submission
        return submission.submission_id

    def get_submission(self, submission_id):
        return self.submissions.get(submission_id)

    def upload_file(self, submission_id, file_name, file_content):
        submission = self.get_submission(submission_id)
        if submission:
            # Placeholder for file upload logic
            return f"File '{file_name}' uploaded successfully for submission ID {submission_id}."
        return "Submission not found."

